[1+(-1)] + [2 + (-2)] + [3 + (-3)]& + [4 + (-4)] \\
{}+ [6 + (-6)] + [12 + (-12)] &= 0 + 0 + 0 + 0 + 0 + 0 \\
&= \boxed{0}.
\end{align*}

