\left(\frac{2}{3}\right)+\left(\frac{1}{2}\cdot \frac{2}{2}-\frac{3}{4}\right)&=\left(\frac{2}{3}\right)+\left(\frac{2-3}{4}\right)\\
&=\left(\frac{2}{3}\right)+\left(-\frac{1}{4}\right)\\
&=\left(\frac{2}{3}\right)-\left(\frac{1}{4}\right).
\end{align*}Finally, we can subtract the two fractions using a common denominator of $12$. \begin{align*}
