\begin{align*}
51 &= 3 \cdot 17,
68 &= 2^2 \cdot 17, \\
85 &= 5 \cdot 17.
\end{align*}
The, least common multiple is the product of the highest powers of each prime factor that appears in any of the factorizations:
\begin{align*}
\text{lcm}(51, 68, 85) &= 2^2 \cdot 3 \cdot 5 \cdot 17^2 \\
&= 4 \cdot 3 \cdot 5 \cdot 289 \\
&= 4180.
\end{align*}
Final Answer: The final answer is $4180$. I hope it is correct.

